import React from "react";
import BootstrapTable from "react-bootstrap-table-next";

const Wines = () => {
  const products = [
    { id: 1, name: "name 1", price: 20 },
    { id: 2, name: "name 2", price: 20 },
    { id: 3, name: "name 3", price: 20 },
  ];
  const columns = [
    {
      dataField: "id",
      text: "Product ID",
    },
    {
      dataField: "name",
      text: "Product Name",
    },
    {
      dataField: "price",
      text: "Product Price",
    },
  ];
  return (
    <div>
      {/* <BootstrapTable keyField="id" data={products} columns={columns} /> */}
    </div>
  );
};

export default Wines;
